from sims4.log import Loggerfrom teleport import teleport_enums# Importation of MasterApprentice Loggertry:    from MasterApprenticeLib.TD1_Lib_ApprenticeLogger import ApprenticeLogger    apprentice_logger = ApprenticeLogger('TD1 Teleport Enums Injector', main_owner='TwelfthDoctor1')except ImportError:    apprentice_logger = Falsetry:    from MasterApprenticeLib.TD1_Lib_MasterLogger import MasterLogger    master_logger = MasterLogger('TD1 Teleport Enums Injector', main_owner='TwelfthDoctor1')except ImportError:    master_logger = Falselogger = Logger('TD1 Teleport Enums Injector', default_owner='TwelfthDoctor1')def add_category_tags(name, number):    with teleport_enums.TeleportStyle.make_mutable():        teleport_enums.TeleportStyle._add_new_enum_value(name, number)        logger.info("Teleport Enum: {} | {} is now injected.".format(name, number))        if apprentice_logger is not None and apprentice_logger is not False:            apprentice_logger.info("Teleport Enum: {} | {} is now injected.".format(name, number))        if master_logger is not None and master_logger is not False:            master_logger.info("Teleport Enum: {} | {} is now injected.".format(name, number))# Add the following EnumValue (FNV24 or 32-bit Hash) and its respective tag below as name, number.# Example: add_category_tags('TeleportTagName', EnumValue)add_category_tags('td1_teleport_mist', 353359)  # <- This TeleportEnum is for the Mist Form Spell in Vampiric Teleport Spellsadd_category_tags('td1_teleport_bat', 12038858)  # <- This TeleportEnum is for the Bat Form Spell in Vampiric Teleport Spellsadd_category_tags('td1_teleport_grimreaper', 3439920)  # <- This TeleportEnum is for the Reaper's Scytheadd_category_tags('td1_teleport_dark_apparate', 8057763)  # <- This TeleportEnum is for the Dark Apparation Spell in Mastery Spellsadd_category_tags('td1_teleport_dark_apparate_always_teleport', 14088733)  # <- This TeleportEnum is for the Dark Apparation Spell in Mastery Spellsadd_category_tags('td1_teleport_dark_apparate_fail', 8257766)  # <- This TeleportEnum is for the Dark Apparation Spell in Mastery Spells